const Home = () => {

    const handleClick = () => {
        console.log("Hello");
    }

    const handClickAgain = (name) => {
        console.log("Hello " + name);
    }
    return (
        <div className="Home">
            <h2> Homepage </h2>
            <button onClick={ handleClick }> Click me </button>
            <button onClick={() => {
                handleClickAgain('Mario')
            } }> Click me again </button>
        </div>
    );
}
 
export default Home;
